import React from "react";

const App = () => {
  let fname = "Dinga";
  let lname = "Raja";
  let num = 12;
  let multiple = num * num;

  let generateOtp = () => {
    let a = Math.floor(Math.random() * 9999 + 1000);
    return a;
  };
   let b =setInterval(generateOtp,1000)

  return (
    <React.Fragment>
      {/* Static Content */}
      <h1> Welcome to React class</h1>

      {/* Static with Dynamic Content */}
      <h3>
        My name is {fname} {lname}
      </h3>

      {/* Dynamic Content */}
      <h3>
        {num} * {num} = {num * num}
      </h3>
      <h3>
        {num} * {num} = {multiple}
      </h3>
      <input type="text"  value={b} className=""/>

      <h1>OTP :- {generateOtp()}</h1>
    </React.Fragment>
  );
};

export default App;
